  \"2016-07-15T19:13:03.369115\",\n\t\"name\": \"services-annual-survey\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Provides estimates of revenue and other
  measures for most traditional service industries. The Bureau of Economic Analysis
  uses these data in its preparation of the Gross Domestic Product (GDP), national
  income and product accounts, and its benchmark and annual input-output tables. The
  Bureau of Labor Statistics uses the data as input to its producer price indexes
  and in developing productivity measurements. The Centers for Medicare and Medicaid
  Services (CMS) uses the data to estimate expenditures for the National Health Accounts.
  The Coalition of Service Industries uses data for general research and planning.
  Trade and professional organizations use the estimates to analyze industry trends
  and benchmark their own statistical programs, develop forecasts, and evaluate regulatory
  requirements. The media use estimates for news reports and background information.
  Private businesses use the estimates to measure market share; analyze business potential;
  and plan investment decisions.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
